import type { JSONSchemaNS } from '../types';


@Component({
  selector: 'jse-integer',
  standalone: true,
  imports: [TypeLabelComponent, IntegerLabelComponent,CreateDescriptionComponent,CommonModule,QualifierMessages],
  template: `
    <div>
